<body class="o-root" data-react-helmet="class" cz-shortcut-listen="true">
  <div id="___gatsby">
    <div style="outline: none" tabindex="-1" id="gatsby-focus-wrapper" class="">
      <header class="c-header o-header">
        <div class="container-layout">
          <nav class="c-header-navbar">
            <div class="c-header-navbar__logo-area">
              <a
                aria-current="page"
                class="c-link-light c-header-navbar__logo-link is-active"
                routerLink="/"
                ><img class="c-logo" src="/assets/logo.svg" alt="Checklist"
              /></a>
            </div>
            <ul
              *ngIf="authSvc.currentUserValue"
              class="c-header-navbar-menu c-header-navbar__menu"
              style="cursor: pointer"
            >
              <li class="c-header-navbar-menu__item">
                <a
                  class="c-link-secondary c-header-navbar-menu__link"
                  routerLink="/index"
                  >Checklists</a
                >
              </li>
              <li class="c-header-navbar-menu__item">
                <a
                  class="c-link-secondary c-header-navbar-menu__link"
                  routerLink="/categories"
                  >Categories</a
                >
              </li>
              <li
                class="c-header-navbar-menu__item"
                *ngIf="authSvc.currentUserValue.role == 'Admin'"
              >
                <a
                  class="c-link-secondary c-header-navbar-menu__link"
                  (click)="openAdmin()"
                  >Admin</a
                >
              </li>
              <li class="c-header-navbar-menu__item">
                <a
                  class="c-link-secondary c-header-navbar-menu__link"
                  (click)="logOut()"
                  >Logout</a
                >
              </li>
            </ul>
            <button
              class="
                c-unstyled-button c-link-light
                c-header-navbar__menu-action
              "
              type="button"
            ></button>
          </nav>
        </div>
      </header>
      <router-outlet></router-outlet>
    </div>
    <div
      id="gatsby-announcer"
      style="
        position: absolute;
        top: 0;
        width: 1px;
        height: 1px;
        padding: 0;
        overflow: hidden;
        clip: rect(0, 0, 0, 0);
        white-space: nowrap;
        border: 0;
      "
      aria-live="assertive"
      aria-atomic="true"
    >
      Navigated to Checklist
    </div>
  </div>
